import React from "react";
import logo from '../logo.png'

export default function Navbar() {
    return (
        <nav className="navbar">
            <img src={logo} width='70px' alt="logo" />
            <ul>    
                <li>Menu</li>
                <li>Price</li>
                <li>Home</li>
            </ul>
        </nav>
    )
}
